import React, { useState } from 'react';
import { yupResolver } from '@hookform/resolvers/yup';
import * as Yup from 'yup';
import { useForm } from 'react-hook-form';
//import img
import Vectors from '../../assets/img/Vectors.png';
import logofb from '../../assets/img/logofb 1.png';
import logoemail from '../../assets/img/logoemail.png';
import DarkMode from '../../assets/img/DarkMode.png';
import { Link } from 'react-router-dom';

const SignUp = () => {
    const [toggle1, setToggle1] = useState(false);
    const [toggle2, setToggle2] = useState(false);

    const formSchema = Yup.object().shape({
        username: Yup.string().required('User name is required'),
        email: Yup.string().required('Email name is required'),
        password: Yup.string()
            .required('Password is required')
            .min(4, 'Password length should be at least 4 characters')
            .max(12, 'Password cannot exceed more than 12 characters'),
        cpassword: Yup.string()
            .required('Confirm Password is required')
            .min(4, 'Password length should be at least 4 characters')
            .max(12, 'Password cannot exceed more than 12 characters')
            .oneOf([Yup.ref('password')], 'Passwords do not match'),
    });

    const {
        register,
        handleSubmit,
        formState: { errors },
    } = useForm({
        mode: 'onTouched',
        resolver: yupResolver(formSchema),
    });
    const onSubmit = (data) => {
        console.log(data);
    };

    return (
        <div className="h-screen w-screen">
            <div className="bg-slate-100 h-full w-full relative flex flex-col ">
                <div className="mx-auto z-10 mt-0 gap-y-4 flex flex-col lg:w-[727px] lg:h-[581px] md:w-[527px] md:h-[581px] w-[327px] ">
                    <form onSubmit={handleSubmit(onSubmit)}>
                        <div className="flex flex-col gap-y-2 font-medium">
                            <h1 className="text-4xl font-sans items-center justify-center flex">Sign Up</h1>
                            <div className="items-center justify-center flex mt-2 lg:mb-10 md:mb-10 mb-4 gap-x-2 ">
                                Do you already have an account?
                                <Link to={'/login'} className="text-[#0702F9]">
                                    Sign In
                                </Link>
                            </div>
                        </div>
                        <div className="flex flex-col lg:gap-y-2 md:gap-y-2 gap-y-4">
                            <div className="">
                                <input
                                    type="text"
                                    name="username"
                                    placeholder="User name"
                                    className="px-3 py-3 rounded-lg bg-[#052B12] text-white w-full"
                                    {...register('username', { required: 'is required' })}
                                />
                                <p className="text-red-600">{errors.username?.message}</p>
                            </div>
                            <div>
                                <input
                                    type="email"
                                    placeholder="Email"
                                    className="px-3 py-3 rounded-lg bg-[#052B12] text-white w-full"
                                    {...register('email', { required: true })}
                                />
                                <p className="text-red-600">{errors.email?.message}</p>
                            </div>
                            <div>
                                <input
                                    className="px-3 py-3 rounded-lg bg-[#052B12] text-white w-full"
                                    size={'44'}
                                    type={toggle1 ? 'text' : 'password'}
                                    placeholder="Password"
                                    name="password"
                                    {...register('password')}
                                />
                                <p className="text-red-600">{errors.password?.message}</p>
                            </div>
                            <div>
                                <input
                                    size={'44'}
                                    type={toggle2 ? 'text' : 'password'}
                                    placeholder="Password"
                                    name="cpassword"
                                    {...register('cpassword')}
                                    className="px-3 py-3 rounded-lg bg-[#052B12] text-white w-full"
                                    {...register('cpassword')}
                                />
                                <p className="text-red-600">{errors.cpassword?.message}</p>
                            </div>
                        </div>
                        <div className=" flex items-center justify-center bg-[#267693] rounded px-2 py-3 mt-10 text-white hover:bg-[#052B12] cursor-pointer">
                            <button className="w-full h-full" type="submit">
                                Sign Up
                            </button>
                        </div>
                        <div className="flex items-center justify-center lg:gap-x-8 md:gap-x-6 gap-x-4 mt-4">
                            <img src={logofb} alt="" className="w-8 h-8 cursor-pointer" />
                            <img src={logoemail} alt="" className="w-8 h-8 cursor-pointer" />
                        </div>
                    </form>
                </div>
                <div className=" object-cover absolute bottom-0 w-full ">
                    <img src={Vectors} alt="" className="w-full lg:h-[60%]  " />
                </div>
                <div className="absolute bottom-6 left-6">
                    <img src={DarkMode} alt="" />
                </div>
            </div>
        </div>
    );
};

export default SignUp;
